import React from "react";
import './advert.scss';

const Advert = (props) => {
    const __URL__ = props.url;
    const __NAME__ = props.name;
    const __CITY__ = props.city;
    const __PRICE__ = props.price + '₽';
    return (
        <div className="advert">
            <img src={__URL__} alt="photo" className="photo"/>
            <div className="name">{__NAME__}</div>
            <div className="price">{__PRICE__}</div>
            <div className="city">{__CITY__}</div>
        </div>
    );
}

export default Advert;
